import React from 'react';
import './header.css';

const defaultProfPic2 = require('./logo.png')

const Header = ({logopic}) =>
    <div id="header">
        <div id="headerlogo">
            <img id="logoimg" src={logopic}/>
        </div>
    </div>;

Home.defaultProps = {
    logopic:defaultProfPic2,
}

export default Header;
